Brandy Aniston, Breanne Benson, Francesca Le, Lexi Belle, Lyla Storm, Michael Vegas, Ryan Mclane, Will Powers,


This taut X-rated version of the thriller classic brings its story to new heights of sexual tension. Breanne Benson delivers a delicious femme fatale performance as Catherine Trammel, the number one suspect in the murder case Nick Curran (Michael Vegas) is trying to crack. He'd like to engage in a penetrating investigation of all three female suspects, if only he could dodge another kind of &quot;internal affair.&quot; But as the plot thickens, Nick is able to wield his eight-inch weapon to bring this hilarious parody to a satisfying climax!
